package com.oz.plan;

public class Calender {
	private int c_no;
	private String s_day;
	private	String s_month;
	private	String s_year;
	private String e_day ;
	private	String e_month ;
	private	String e_year;
	private String e_name;
	
public Calender() {
	// TODO Auto-generated constructor stub
}
public int getC_no() {
	return c_no;
}
public void setC_no(int c_no) {
	this.c_no = c_no;
}
public String getS_day() {
	return s_day;
}
public void setS_day(String s_day) {
	this.s_day = s_day;
}
public String getS_month() {
	return s_month;
}
public void setS_month(String s_month) {
	this.s_month = s_month;
}
public String getS_year() {
	return s_year;
}
public void setS_year(String s_year) {
	this.s_year = s_year;
}
public String getE_day() {
	return e_day;
}
public void setE_day(String e_day) {
	this.e_day = e_day;
}
public String getE_month() {
	return e_month;
}
public void setE_month(String e_month) {
	this.e_month = e_month;
}
public String getE_year() {
	return e_year;
}
public void setE_year(String e_year) {
	this.e_year = e_year;
}
public String getE_name() {
	return e_name;
}
public void setE_name(String e_name) {
	this.e_name = e_name;
}
public Calender(int c_no, String s_day, String s_month, String s_year, String e_day, String e_month, String e_year,
		String e_name) {
	super();
	this.c_no = c_no;
	this.s_day = s_day;
	this.s_month = s_month;
	this.s_year = s_year;
	this.e_day = e_day;
	this.e_month = e_month;
	this.e_year = e_year;
	this.e_name = e_name;
}


	
	
	
	
}
